// 生成粒子数组
function effectImg1(x, y) {
  let points = [];
  // 每组生成数个大小颜色渐变的粒子，产生拖尾效果
  for (let i = 0; i < keyPoints1.length; i++) {
    // 产生拖尾
    let ps = [];
    let num = 18; //一组数量
    let r = 4; //粒子大小
    let t = 0; //延迟时间
    let a = 1; //透明度

    for (let j = 0; j < num; j++) {
      let p = new effect1(keyPoints1[i], x, y);
      t -= 2;
      r -= 0.2;
      a -= 0.1;
      p.t = Math.floor(t * 10) / 10;
      p.r = Math.floor(r * 10) / 10;
      p.color = "rgba(255,255,0," + Math.floor(a * 10) / 10 + ")";
      ps.push(p);
    }
    points.push(ps);
  }

  return points;
}
